import React from "react";

export default function Header() {
    return (
        <>
            <nav className="nav">
                <div className="navbar">
                    <ul className="navlink">
                        <li><a href="#home">Home</a></li>
                    </ul>
                </div>
            
            </nav>
        </>
    )
}
